import React, { Component } from "react";
import {  SideNavItem } from "react-materialize";
import { connect } from "react-redux";

const mapStateToProps = state => {
    return { authenticated: state.authenticated}
}

class SideNavItems extends Component {
    render() {
        const {authenticated } = this.props

        return (
            <div >
                {authenticated? 
                    <div>
                    <SideNavItem
                        user={{
                            background: "img/jeremy-bishop-BuQ-jgeexaQ-unsplash.jpg",
                            email: "jdandturk@gmail.com",
                            name: "John Doe"
                        }}
                        userView
                    />
                    <SideNavItem  href='/project' icon='assignment_turned_in'>
                        Projects
                    </SideNavItem>
                    <SideNavItem href='/business' icon='business'>Business</SideNavItem>
                    <SideNavItem divider />
                    {/* <SideNavItem subheader>My Account</SideNavItem> */}
                    <SideNavItem href='/users/me' waves icon='person_pin'>
                        Profile
                    </SideNavItem>
                    <SideNavItem href='/logout' waves icon='power_settings_new'>
                        Logout
                    </SideNavItem>
                    </div>
                    :  <SideNavItem href='/login' waves icon='trending_flat'>
                        Login
                        </SideNavItem>
                    }

            </div>
        )
    }
}

export default connect(mapStateToProps)(SideNavItems)
